import { Button, InputAdornment, TextField } from "@mui/material"
import axios from "axios"
import React from "react"
import style from './CadastroVeicular.module.scss';


export const CadastroVeicular = ({ placa, setCadastroVeiculo, loginUser, setVeiculo }) => {
    const [info, setInfo] = React.useState({
        proprietario: '',
        documento: '',
        veiculo: '',
        modelo: '',
        chassi: '',
        placa: '',
        motor: '',
        fabricante: '',
        especieVeiculo: '',
        corVeiculo: '',
        combustivel: '',
        cilindrada: '',
        anoFabricacao: '',
        anoModelo: '',
        municipio: '',
        uf: '',
        tipoVeiculo: '',
        potencia: '',
        passageiroMax: '',
        cadastradoPor: {
            id: loginUser.id,
            nome: loginUser.nome
        },
    })

    const Resposta = async () => {
        let consulta = await axios.get('http://localhost:3001/Servicos', { params: { placa } })
        // console.log(consulta.data)
        let { RESPOSTA } = consulta.data
        if (RESPOSTA.BASE_AGREGADOS.situacao === true) {

        } else {
            let { BASE_AGREGADOS } = RESPOSTA
            setInfo(a => ({
                ...a,
                veiculo: BASE_AGREGADOS.Grupo_Modelo ? BASE_AGREGADOS.Grupo_Modelo : '',
                modelo: BASE_AGREGADOS.MarcaModelo ? BASE_AGREGADOS.MarcaModelo : '',
                chassi: BASE_AGREGADOS.chassi ? BASE_AGREGADOS.chassi : '',
                placa: BASE_AGREGADOS.Placa ? BASE_AGREGADOS.Placa : '',
                motor: BASE_AGREGADOS.Motor ? BASE_AGREGADOS.Motor: '',
                fabricante: BASE_AGREGADOS.Fabricante ? BASE_AGREGADOS.Fabricante : '',
                especieVeiculo: BASE_AGREGADOS.EspecieVeiculo ? BASE_AGREGADOS.EspecieVeiculo : '',
                corVeiculo: BASE_AGREGADOS.CorVeiculo ? BASE_AGREGADOS.CorVeiculo : '',
                combustivel: BASE_AGREGADOS.Combustivel ? BASE_AGREGADOS.Combustivel : '',
                cilindrada: BASE_AGREGADOS.Cilindradas ? BASE_AGREGADOS.Cilindradas : '',
                anoFabricacao: BASE_AGREGADOS.AnoFabricacao ? BASE_AGREGADOS.AnoFabricacao : '',
                anoModelo: BASE_AGREGADOS.AnoModelo ? BASE_AGREGADOS.AnoModelo : '',
                municipio: BASE_AGREGADOS.Municipio ? BASE_AGREGADOS.Municipio : '',
                uf: BASE_AGREGADOS.UF ? BASE_AGREGADOS.UF : '',
                tipoVeiculo: BASE_AGREGADOS.TipoVeiculo ? BASE_AGREGADOS.TipoVeiculo : '',
                potencia: BASE_AGREGADOS.Potencia ? BASE_AGREGADOS.Potencia : '',
                passageiroMax: BASE_AGREGADOS.QtdPax ? BASE_AGREGADOS.QtdPax : '',
            }))
        }
    }

    React.useEffect(() => {
        Resposta()
    }, [placa])

    const SalvarVeiculo = (e) => {
        e.preventDefault()
        axios.post('http://localhost:3001/Servicos/CadastrarVeiculo', { info })
            .then(res => {
                // console.log(res);
                // console.log(info);
                setCadastroVeiculo(true);
                setVeiculo(res);
            })
            .catch(err => {
                console.log(err);
            })
    }

    const padrao = {
        minWidth: '30vw',
        margin: 1.5,
    }

    return (
        <>
            {info !== '' ?
                <form className={style.formulario} onSubmit={SalvarVeiculo}>
                    <TextField
                        variant="standard"
                        sx={padrao}
                        size='small'
                        label='Proprietário'
                        value={info.proprietario}
                        onChange={(e) => setInfo(a => ({ ...a, proprietario: e.target.value }))}
                        required
                    />
                    <TextField variant='standard' sx={padrao} size='small' label='CPF / CNPJ' value={info.documento} onChange={(e) => setInfo(a => ({ ...a, documento: e.target.value }))} required />
                    <TextField variant='standard' sx={padrao} size='small' label='Veículo' value={info.veiculo} onChange={(e) => setInfo(a => ({ ...a, veiculo: e.target.value }))} required />
                    <TextField variant='standard' sx={padrao} size='small' label='Modelo' value={info.modelo} onChange={(e) => setInfo(a => ({ ...a, modelo: e.target.value }))} required />
                    <TextField variant='standard' sx={padrao} size='small' label='Chassi' value={info.chassi} onChange={(e) => setInfo(a => ({ ...a, chassi: e.target.value }))} required />
                    <TextField variant='standard' sx={padrao} size='small' label='Placa' value={info.placa} onChange={(e) => setInfo(a => ({ ...a, placa: e.target.value }))} required />
                    <TextField variant='standard' sx={padrao} size='small' label='Motor' value={info.motor} onChange={(e) => setInfo(a => ({ ...a, motor: e.target.value }))} required />
                    <TextField variant='standard' sx={padrao} size='small' label='Fabricante' value={info.fabricante} onChange={(e) => setInfo(a => ({ ...a, fabricante: e.target.value }))} required />
                    <TextField variant='standard' sx={padrao} size='small' label='Espécie do Veículo' value={info.especieVeiculo} onChange={(e) => setInfo(a => ({ ...a, especieVeiculo: e.target.value }))} required />
                    <TextField variant='standard' sx={padrao} size='small' label='Cor do Veículo' value={info.corVeiculo} onChange={(e) => setInfo(a => ({ ...a, corVeiculo: e.target.value }))} required />
                    <TextField variant="standard" sx={padrao} size='small' label='Combustível' value={info.combustivel} onChange={(e) => setInfo(a => ({ ...a, combustivel: e.target.value }))} required />
                    <TextField variant="standard" sx={padrao} size='small' label='Cilindrada' value={info.cilindrada} onChange={(e) => setInfo(a => ({ ...a, cilindrada: e.target.value }))} required />
                    <TextField variant="standard" sx={padrao} size='small' label='Ano de Fabricação' value={info.anoFabricacao} onChange={(e) => setInfo(a => ({ ...a, anoFabricacao: e.target.value }))} required />
                    <TextField variant="standard" sx={padrao} size='small' label='Ano do Modelo' value={info.anoModelo} onChange={(e) => setInfo(a => ({ ...a, anoModelo: e.target.value }))} required />
                    <TextField variant="standard" sx={padrao} size='small' label='Município' value={info.municipio} onChange={(e) => setInfo(a => ({ ...a, municipio: e.target.value }))} required />
                    <TextField variant="standard" sx={padrao} size='small' label='UF' value={info.uf} onChange={(e) => setInfo(a => ({ ...a, uf: e.target.value }))} required />
                    <TextField variant="standard" sx={padrao} size='small' label='Tipo do Veículo' value={info.tipoVeiculo} onChange={(e) => setInfo(a => ({ ...a, tipoVeiculo: e.target.value }))} required />
                    <TextField variant="standard" sx={padrao} size='small' label='Potencia' value={info.potencia} onChange={(e) => setInfo(a => ({ ...a, potencia: e.target.value }))} InputProps={{ endAdornment: <InputAdornment position='end'>CV</InputAdornment> }} required />
                    <TextField variant="standard" sx={padrao} size='small' label='Lotação Máxima' value={info.passageiroMax} onChange={(e) => setInfo(a => ({ ...a, passageiroMax: e.target.value }))} InputProps={{ endAdornment: <InputAdornment position='end'>Passageiros</InputAdornment> }} required />
                    <p style={{ minWidth: "31.2vw", margin: 'auto 2.8px' }} ></p>
                    <Button sx={{ m: '0 40%' }} color='success' type='submit' fullWidth>Salvar</Button>
                </form>
                : <p>Loading...</p>}
        </>
    )
}
